import React, { useState } from "react";
import { BrowserRouter as Router, Route, Routes, Link, useNavigate } from "react-router-dom";
import "./styles.css";

const images = ["image1.jpg", "image2.jpg", "image3.jpg", "image4.jpg"];

const Gallery = ({ selectedImages, setSelectedImages }) => {
  const toggleSelection = (image) => {
    setSelectedImages((prev) =>
      prev.includes(image) ? prev.filter((img) => img !== image) : [...prev, image]
    );
  };

  return (
    <div className="p-5">
      <h1 className="text-xl font-bold mb-4">Odaberite fotografije</h1>
      <div className="grid grid-cols-2 gap-4">
        {images.map((image) => (
          <div key={image} className="border p-2 cursor-pointer" onClick={() => toggleSelection(image)}>
            <img src={image} alt={image} className={selectedImages.includes(image) ? "border-4 border-blue-500" : ""} />
          </div>
        ))}
      </div>
      <Link to="/form" className="block mt-4 p-2 bg-blue-500 text-white text-center rounded">Dalje</Link>
    </div>
  );
};

const Form = ({ name, setName }) => {
  const navigate = useNavigate();
  return (
    <div className="p-5">
      <h1 className="text-xl font-bold mb-4">Unesite ime i prezime</h1>
      <input
        type="text"
        value={name}
        onChange={(e) => setName(e.target.value)}
        className="border p-2 w-full"
        placeholder="Ime i prezime"
      />
      <button onClick={() => navigate("/checkout")} className="block mt-4 p-2 bg-green-500 text-white text-center rounded w-full">
        Dalje
      </button>
    </div>
  );
};

const Checkout = ({ selectedImages, name }) => {
  const total = selectedImages.length * 2;
  return (
    <div className="p-5">
      <h1 className="text-xl font-bold mb-4">Korpa</h1>
      <p>Ime: {name}</p>
      <p>Broj slika: {selectedImages.length}</p>
      <p>Ukupna cena: {total} EUR</p>
      <div className="mt-4">
        <Link to="/confirmation" className="block p-2 bg-gray-500 text-white text-center rounded mb-2">Plati gotovinom</Link>
        <button className="block p-2 bg-yellow-500 text-white text-center rounded w-full">Plati PayPal-om</button>
      </div>
    </div>
  );
};

const Confirmation = () => (
  <div className="p-5 text-center">
    <h1 className="text-xl font-bold mb-4">Porudžbina prosleđena!</h1>
    <p>Dođite do pulta za 30 minuta.</p>
  </div>
);

const App = () => {
  const [selectedImages, setSelectedImages] = useState([]);
  const [name, setName] = useState("");

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Gallery selectedImages={selectedImages} setSelectedImages={setSelectedImages} />} />
        <Route path="/form" element={<Form name={name} setName={setName} />} />
        <Route path="/checkout" element={<Checkout selectedImages={selectedImages} name={name} />} />
        <Route path="/confirmation" element={<Confirmation />} />
      </Routes>
    </Router>
  );
};

export default App;
